        <div class="overview text-center">
            <div class="w-75 d-inline-block">
                <h2 class="overview__title">
                    Tong quan ve quizne
                </h2>
                <div class="overview__list">
                    <div class="overview__item">
                        <h5 class="title__item">Chế độ chơi đơn</h5>
                        <p class="overview__desc">Ở chế độ “Chơi đơn”, bạn có thể đánh giá kiến thức và khả năng
                            của bản thân.
                            Khám phá các tính năng hấp dẫn như xáo trộn câu hỏi và câu trả lời, đồng hồ đếm
                            ngược, v.v.</p>
                        <div class="overview__image">
                            <img class="w-100" src="public/image/single-play.gif" alt="single-play">
                        </div>
                    </div>

                    <div class="overview__item">
                        <h5 class="title__item">Tạo những bộ Quiz</h5>
                        <p class="overview__desc">Bạn sẽ có thể tạo những câu hỏi bằng cách sử dụng công cụ “Tạo
                            Quiz”. Với các tùy chọn thêm hình ảnh, video, thay đổi thời gian và điểm số,
                            lưu và chia sẻ với cộng đồng, bạn có thể dễ dàng cá nhân hóa câu hỏi.</p>
                        <div class="overview__image">
                            <img class="w-100" src="public/image/create-a-question.gif" alt="single-play">
                        </div>
                    </div>

                    <div class="overview__item">
                        <h5 class="title__item">“Host” - Tạo và điều khiển phòng chơi</h5>
                        <p class="overview__desc">Bạn sẽ có thể điều khiển trò chơi khi chọn làm “Host”. Hãy thể
                            hiện sự sáng tạo của mình để bắt đầu cuộc ganh đua và vươn lên vị trí người dẫn đầu
                            về trò chơi trong “cuộc đua” gay cấn.</p>
                        <div class="overview__image">
                            <img class="w-100" src="public/image/host.gif" alt="single-play">
                        </div>
                    </div>

                    <div class="overview__item">
                        <h5 class="title__item">Nhiều chế độ chơi</h5>
                        <p class="overview__desc">
                            Nhiều chế độ chơi hấp dẫn như Multiple Choice, Type the Answer, True or False,
                            Puzzle, Reorder, v.v. giúp thư viện câu hỏi luôn thú vị và đa dạng.
                        </p>
                        <div class="overview__image">
                            <img class="w-100" src="public/image/mutiple-choice.gif" alt="single-play">
                        </div>
                    </div>
                </div>
            </div>
        </div>






